package irvine.oeis.a000;

import java.math.BigDecimal;

/**
 * A000249 Nearest integer to modified Bessel function K_n(5).
 * @author Sean A. Irvine
 */
public class A000249 extends A000155 {

  @Override
  protected String k0() {
    // High precision constant BesselK(0,5) computed by Maple
    return "0.";
  }

  @Override
  protected String k1() {
    // High precisions constant BesselK(1,5) computed by Maple
    return "0.";
  }

  private static final BigDecimal FIVE = new BigDecimal("5");

  @Override
  protected BigDecimal z() {
    return FIVE;
  }
}
